import React from 'react';

class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {name: "hoge"}
  }
  handleClick() {
    this.setState({name: "Push Now"});
  }
  render() {
    return(
      <div>
        <p>{this.state.name}</p>
        <button onClick={() => {this.setState({name: "push"})}}>Push here</button>
      </div>
    );
  }
}

export default App;
